import React from 'react';

const SiteTitle = () => (
  <h1 className="text-center text-4xl md:text-6xl py-12 md:py-8">
    <a className="text-white no-underline" href="/">
      Hacktober<span>fest</span> <br />Checker
    </a>
  </h1>
);

export default SiteTitle;
